class BooksUri {

  BooksUri({
      Context? context,
      List<Graph>? graph,}){
    _context = context;
    _graph = graph;
}

  BooksUri.fromJson(dynamic json) {
    _context = json['@context'] != null ? Context.fromJson(json['@context']) : null;
    if (json['@graph'] != null) {
      _graph = [];
      json['@graph'].forEach((v) {
        _graph?.add(Graph.fromJson(v));
      });
    }
  }

  Context? _context;
  List<Graph>? _graph;


BooksUri copyWith({  Context? context,
  List<Graph>? graph,
}) => BooksUri(  context: context ?? _context,
  graph: graph ?? _graph,
);
  Context? get context => _context;
  List<Graph>? get graph => _graph;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_context != null) {
      map['@context'] = _context?.toJson();
    }
    if (_graph != null) {
      map['@graph'] = _graph?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

